for i_band=1:n_bands
    [band_peaks, i_peaks] = findpeaks(QE_mat(i_band,:),'MinPeakProminence',0.001);
    wl_i = wl(i_peaks);
    %     figure
    %     plot(wl, quantum_eff(i_band,:), '--', wl_i, G_i, 'r*');
