        [G_i_max, i_max] = max(band_peaks(i_filtered_peaks));
        wl_filtered_peaks = wl_i(i_filtered_peaks);
        wl_peak(i_band) = wl_filtered_peaks(i_max);
        QE_peak(i_band) = G_i_max;
