    end
end

wl_m = wl*1e-9; % [m]
exp_time = exp_time/1e6; % [s]
A = (5.5e-6)^2; % [m2]
h = 6.62607015e-34; % [Js]
c = 299792458; % [m/s]
n_w = 11519; % full well capacity [-]
n_bits = 8;

G_mat = zeros(size(QE_mat));
for i = 1:size(QE_mat,1)
    G_mat(i,:) = (2^n_bits-1)*(wl_m.*QE_mat(i,:)*exp_time*A*pi)/(h*c*n_w);
end